import React from 'react';
import './App.css';
import {
    BrowserRouter as Router,
    Routes,
    Route,
} from "react-router-dom";
import BooksList from './BooksList'; // Importuojame naują komponentą
import { NavBar } from './Navbar';

function App() {
    return (
        <>
        <div className="App">
            <header className="App-header">
                <h1 className='main-title'>Welcome to the library!</h1>
                <BooksList /> {/* Priedame knygų sąrašą*/}
            </header>
        </div>
        <NavBar />
        <Router>
            <Routes>
                <Route path="/other" element={<BooksList />} />
            </Routes>
        </Router>
        </>
    );
}

export default App;
